import './App.css';
import React, { useState } from 'react';


function App() {
  const [button1, setButton1] = useState("white");

  const changeColor = () =>{
    if(button1 === "white"){
      setButton1("red");
    }
    else{
      setButton1("white");
    }
    console.log(button1)
  }
  return (
    <div className="App">
      <button onClick={(e)=> changeColor()}>
                  Button1
             </button>
    </div>
  );
}

export default App;
